  return (
    <KategoriSayfasi
      kategoriAdi="Okul Öncesi Kitapları"
      aciklama="Okul öncesi çocukların gelişimini destekleyen eğitici ve eğlenceli kitaplar."
    />
  );
};

export default OkulOncesiKitaplari;
